apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: |-
      [
        {
          "apiVersion": "latency.redhat.com/v1alpha1",
          "kind": "LatencyCheck",
          "metadata": {
            "name": "lc-longlived"
          },
          "spec": {
            "acmIntegration": {
              "clusterLocationLabel": "testlabel",
              "placementRuleClusterReplicas": 1,
              "placementRuleName": "test",
              "placementRuleNamespace": "latencychecks"
            },
            "locations": [
              "NA.*"
            ],
            "numberOfRuns": 1,
            "outputLocationsNumber": 3,
            "provider": {
              "apiKey": "2a098fd9-281b-4670-a838-d4b1fde24cb1",
              "providerName": "ddosify"
            },
            "scheduleDefinition": "*/1 * * * *",
            "scheduled": true,
            "targetURL": "https://google.com",
            "waitInterval": "10s"
          }
        }
      ]
    capabilities: Basic Install
    operators.operatorframework.io/builder: operator-sdk-v1.23.0
    operators.operatorframework.io/project_layout: go.kubebuilder.io/v3
  name: latencycheck-operator.v0.0.1
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - description: LatencyCheck is the Schema for the latencychecks API
      displayName: Latency Check
      kind: LatencyCheck
      name: latencychecks.latency.redhat.com
      version: v1alpha1
  description: Checks latencies for your application endpoints and can be integrated
    with RHACM
  displayName: Latency Checks Operator
  icon:
  - base64data: ""
    mediatype: "image/png"
  install:
    spec:
      clusterPermissions:
      - rules:
        - apiGroups:
          - apps.open-cluster-management.io
          resources:
          - placementrules
          verbs:
          - create
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - ""
          resources:
          - namespaces
          verbs:
          - get
          - list
          - watch
        - apiGroups:
          - latency.redhat.com
          resources:
          - latencychecks
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - latency.redhat.com
          resources:
          - latencychecks/finalizers
          verbs:
          - update
        - apiGroups:
          - latency.redhat.com
          resources:
          - latencychecks/status
          verbs:
          - get
          - patch
          - update
        - apiGroups:
          - authentication.k8s.io
          resources:
          - tokenreviews
          verbs:
          - create
        - apiGroups:
          - authorization.k8s.io
          resources:
          - subjectaccessreviews
          verbs:
          - create
        serviceAccountName: k8soperator-controller-manager
      deployments:
      - label:
          control-plane: controller-manager
        name: latencychecks-controller-manager
        spec:
          replicas: 1
          selector:
            matchLabels:
              control-plane: controller-manager
          strategy: {}
          template:
            metadata:
              annotations:
                kubectl.kubernetes.io/default-container: manager
              labels:
                control-plane: controller-manager
            spec:
              containers:
              - args:
                - --secure-listen-address=0.0.0.0:8443
                - --upstream=http://127.0.0.1:8080/
                - --logtostderr=true
                - --v=0
                image: gcr.io/kubebuilder/kube-rbac-proxy:v0.13.0
                name: kube-rbac-proxy
                ports:
                - containerPort: 8443
                  name: https
                  protocol: TCP
                resources:
                  limits:
                    cpu: 500m
                    memory: 128Mi
                  requests:
                    cpu: 5m
                    memory: 64Mi
                securityContext:
                  allowPrivilegeEscalation: false
                  capabilities:
                    drop:
                    - ALL
              - args:
                - --health-probe-bind-address=:8081
                - --metrics-bind-address=127.0.0.1:8080
                - --leader-elect
                command:
                - /manager
                image: quay.io/mavazque/latencychecks-operator:v0.0.1
                livenessProbe:
                  httpGet:
                    path: /healthz
                    port: 8081
                  initialDelaySeconds: 15
                  periodSeconds: 20
                name: manager
                readinessProbe:
                  httpGet:
                    path: /readyz
                    port: 8081
                  initialDelaySeconds: 5
                  periodSeconds: 10
                resources:
                  limits:
                    cpu: 500m
                    memory: 128Mi
                  requests:
                    cpu: 10m
                    memory: 64Mi
                env:
                  - name: WATCH_NAMESPACE
                    valueFrom:
                      fieldRef:
                        fieldPath: metadata.annotations['olm.targetNamespaces']
                securityContext:
                  allowPrivilegeEscalation: false
                  capabilities:
                    drop:
                    - ALL
              securityContext:
                runAsNonRoot: true
              serviceAccountName: k8soperator-controller-manager
              terminationGracePeriodSeconds: 10
      permissions:
      - rules:
        - apiGroups:
          - ""
          resources:
          - configmaps
          verbs:
          - get
          - list
          - watch
          - create
          - update
          - patch
          - delete
        - apiGroups:
          - coordination.k8s.io
          resources:
          - leases
          verbs:
          - get
          - list
          - watch
          - create
          - update
          - patch
          - delete
        - apiGroups:
          - ""
          resources:
          - events
          verbs:
          - create
          - patch
        serviceAccountName: k8soperator-controller-manager
    strategy: deployment
  installModes:
  - supported: true
    type: OwnNamespace
  - supported: true
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  keywords:
  - latency
  - ddosify
  - latencycheck
  - latencies
  - rhacm
  - acm
  links:
  - name: Latency Check Operator
    url: https://github.com/RHsyseng/ddosify-tooling/tree/main/tooling/k8soperator
  maturity: alpha
  provider:
    name: Red Hat Telco Operations
    url: https://github.com/RHsyseng/
  version: 0.0.1
